	function formatNum(){
		$(".bsNum,.bkNum").each(function(){
			var curValText = $(this).text();
			if(isNaN(curValText)){
				return;
			}
				
			var dianIndex = curValText.indexOf(".");
			if(dianIndex > 0){
				$(this).html(curValText.substring(0,dianIndex) + "<g>"+curValText.substring(dianIndex)+"</g>");
			}
		});
	}
	
	
	
//jquery载入插件
	;(function($){
	    $.fn.loading = function(curValue,maxValue){
			var curValue = parseFloat(curValue).toFixed(2);
			var maxValue = parseFloat(maxValue);
			var pixSyn = "TH/S";
			var toGet = function(val){
				if((val + 1) % 12 == 0){
					return val + 1;
				}else{
					return toGet(val + 1);
				}
			};
			var getMaxValue = function(val){
				if(val < 10){
					val = Number(val); 
					val = val * 100;
					if(val % 12 == 0){
						return (val + 10) / 100;
					}
					val = toGet(val);
					return val / 100;
				}else{
					val = parseInt(val);
					var vl = 12 -  parseInt(Number(val) % 12);
					return val + vl;
				}
			};
			if(curValue > 1000){
				curValue = (curValue / 1000).toFixed(2);
				pixSyn = "PH/S";
			}
			//自动计算最大值
			if(!maxValue){
				maxValue = getMaxValue(curValue);
			}
			var pixStr   = "<div class='pointer'></div>"; 
			    pixStr   += "<span class='pix-syn'>"+pixSyn+"</span>"; 
			var pixAngle = (curValue*240/maxValue).toFixed(0);
			var pixStep = maxValue/12 ;
			for(var i = 0 ; i < 13 ; i ++){
				var ps = pixStep * i;
				if(ps % 1 == 0){
					pixStr += "<span class='pix-"+i+"'>"+parseInt(ps)+"</span>";
				}else{
					if(curValue < 1)
						pixStr += "<span class='pix-"+i+"'>"+ps.toFixed(2)+"</span>";
					else
						pixStr += "<span class='pix-"+i+"'>"+ps.toFixed(1)+"</span>";
				}
			};
	        return $(this).each(function(){
				$(this).find(".dash-pix").html(pixStr);
				$(this).find(".dash-data").text(curValue);
				$(this).find(".pointer").css({
					'-webkit-transform':'rotate('+pixAngle+'deg)',
					'transform':'rotate('+pixAngle+'deg)'
				})
	        });
	    }; 
	})(jQuery);
